import "./App.css";
import { useState } from "react";

const List = () => {
  const [age, setAge] = useState(0);

  return (
    <div>
      <h1>Dinner time</h1>
      <h2>Vote for these shit </h2>
      <button
        onClick={() => {
          setAge(age + 1);
        }}
      >
        +
      </button>
      <button
        onClick={() => {
          setAge(age - 1);
        }}
      >
        -
      </button>
      <h2>This dish have {age}</h2>
    </div>
  );
};

function App() {
  return (
    <>
      <List />
    </>
  );
}

export default App;
